var BubbleShoot=window.BubbleShoot||{}
BubbleShoot.Sounds=(function(){let soundObjects=[]
for(let i=0;i<10;i++){soundObjects.push(new Audio())}let curSoundNum=0,Sounds={play:function(url,volume){if(Modernizr.audio){let sound=soundObjects[curSoundNum]
sound.src=url
sound.volume=volume
sound.play()
curSoundNum++
if(curSoundNum>=soundObjects.length){curSoundNum=curSoundNum%soundObjects.length}}}}
return Sounds})()